import React from "react";
import Layout from "./Layout/Layout";
import { Grid } from "@mantine/core";
import ResponsivePhone from "../ResponsivePhone";
import HomeCustomize from "./Customize/Customize";

const Index = () => {
  return (
    <Grid>
      <Grid.Col span={4} h={550} style={{ overflowY: "auto" }}>
        <Layout />
      </Grid.Col>
      <Grid.Col span={4} mt="xs" >
        <ResponsivePhone />
      </Grid.Col>
      <Grid.Col span={4} h={550} style={{ overflowY: "auto" }}>
        <HomeCustomizeCustomize />
      </Grid.Col>
    </Grid>
  );
};

export default Index;
